  \"Renewal of 'Capture of Down-Scale Climate Change Models.' Part B: The Application
  of High Resolution Climate Models for Avian Conservation\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 1,\n\t\t\"recent\": 1\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:48:50.436780\",\n\t\"name\": \"renewal-of-capture-of-down-scale-climate-change-models-part-b-the-application-of-high-reso\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This project will develop species distribution
  models (SDM) to evaluate current and future occurrence and density of wetland-dependent
  birds relative to several predictors, including land use patterns, wetland condition
  and connectivity, geomorphic setting and climate. These tools will suggest which
  wetland-dependent bird species appear most vulnerable to climate and land use change
  based on the expected extent of range change under various scenarios. Knowledge
  of natural history and habitat associations of species coupled with coefficients
  from regression models will provide insight into the potential reasons for species
  vulnerability. This information will be valuable in the development of management
  strategies.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
